import path from 'path';

export default async function(page, fileUrl, screenshotsDir) {
  try {
    // Navigate to the HTML file
    await page.goto(fileUrl);
    await page.waitForLoadState('networkidle');

    // Take initial screenshot
    const screenshots = [];
    await page.screenshot({ path: path.join(screenshotsDir, 'step_1_initial.png') });
    screenshots.push(path.join(screenshotsDir, 'step_1_initial.png'));

    // Wait for the "Sort and Filter Controls" to appear (contains the view toggle)
    await page.waitForSelector('.sort-filter-controls', { timeout: 5000 });

    // Try to find the List View button by its title attribute
    const listViewBtn = await page.$('button.view-btn[title="List View"]');
    if (!listViewBtn) {
      throw new Error('List View button not found');
    }

    // Click the List View button
    await listViewBtn.click();

    // Wait for the products-list container to appear (indicating List View is active)
    await page.waitForSelector('.products-list', { timeout: 5000 });

    // Take screenshot after switching to List View
    await page.screenshot({ path: path.join(screenshotsDir, 'step_2_list_view.png') });
    screenshots.push(path.join(screenshotsDir, 'step_2_list_view.png'));

    // Extract data: check if the List View button now has the "active" class and products-list is visible
    const isListViewActive = await page.evaluate(() => {
      const btn = document.querySelector('button.view-btn[title="List View"]');
      return btn && btn.classList.contains('active');
    });
    const productsListExists = await page.$('.products-list') !== null;

    return {
      success: true,
      action: "Switched to List View Mode by clicking the List View toggle button",
      extractedData: {
        listViewButtonActive: isListViewActive,
        productsListVisible: productsListExists
      },
      screenshots,
      error: null
    };
  } catch (error) {
    return {
      success: false,
      action: "Failed to complete task",
      extractedData: {},
      screenshots: [],
      error: error.message
    };
  }
}
